import React from "react";

const ListingDisplay = (props)=>{

const renderData=({listData})=>{
    if(listData){
        if(listData.length>0){
            return(
                <h1>Data</h1>
            )
        }
        else{
            return(
                <h1>No Data Found!</h1>
            )
        }
    }

}

    return(
        <div class="main-div">
            {renderData(props)}
        </div>
    )
}

export default ListingDisplay;
